import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a product detail modal (simulate clicking on the first product card)
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for the product modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('.product-detail-info', { timeout: 5000 });

    // Take screenshot of product detail modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Change quantity in the quantity selector to 3
    await page.waitForSelector('#quantity', { timeout: 5000 });
    await page.selectOption('#quantity', '3');

    // Take screenshot after changing quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_selected.png'));

    // Click "Add to Cart" button in the modal
    await page.waitForSelector('.add-to-cart.large', { timeout: 5000 });
    await page.click('.add-to-cart.large');

    // Wait for notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_added_to_cart.png'));

    // Close the product modal
    await page.waitForSelector('#productModal .close', { timeout: 5000 });
    await page.click('#productModal .close');

    // Open the cart modal by clicking the cart icon/counter
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartItems', { timeout: 5000 });

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_cart_modal.png'));

    // Extract cart items and their quantities
    const cartItems = await page.$$eval('.cart-item', items =>
      items.map(item => {
        const title = item.querySelector('.cart-item-title')?.textContent?.trim() || '';
        const quantity = item.querySelector('.quantity')?.textContent?.trim() || '';
        return { title, quantity };
      })
    );

    return {
      success: true,
      action: "Updated cart item quantity to 3 for the first product and verified in cart modal",
      extractedData: {
        cartItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
